import { createContext } from "react";

import {
  ItemCompanyProps,
  ListGuestProps,
  ListEventsProps,
} from "../../@types";

interface InfoProps {
  timeNow: string;
  setTimeNow: (c: string) => void;
  allEvents: ListEventsProps[];
  setAllEvents: (c: ListEventsProps[]) => void;
  selectedEvent: string;
  setSelectedEvent: (c: string) => void;
  completeList: ListGuestProps[];
  setCompleteList: (c: ListGuestProps[]) => void;
  allCompanies: ItemCompanyProps[];
  setAllCompanies: (c: ItemCompanyProps[]) => void;
  filteredList: ListGuestProps[];
  setFilteredList: (c: ListGuestProps[]) => void;
  searchGuest: string;
  setSearchGuest: (c: string) => void;
  totalGuests: number;
  // setTotalGuests: (c: number) => void;
  guests: ListGuestProps[];
  setGuests: (c: ListGuestProps[]) => void;
  perPage: number;
  setPerPage: (c: number) => void;
  skip: number;
  setSkip: (c: number) => void;
}

export const InfoContext = createContext<InfoProps>({
  timeNow: "",
  setTimeNow: () => {},
  allEvents: [],
  setAllEvents: () => {},
  selectedEvent: "",
  setSelectedEvent: () => {},
  completeList: [],
  setCompleteList: () => {},
  allCompanies: [],
  setAllCompanies: () => {},
  filteredList: [],
  setFilteredList: () => {},
  searchGuest: "",
  setSearchGuest: () => {},
  totalGuests: 0,
  // setTotalGuests: () => {},
  guests: [],
  setGuests: () => {},
  perPage: 5,
  setPerPage: () => {},
  skip: 0,
  setSkip: () => {},
});
